/**
 * Get Cloudinary URL for a local image path
 * @param {string} localPath - Original local image path
 * @param {string} variant - Image variant (original, optimized, hero, thumb, small)
 * @returns {string} Cloudinary URL
 */
export function getCloudinaryUrl(localPath, variant = 'optimized') {
  const mapping = CLOUDINARY_IMAGES[localPath];
  if (!mapping) {
    return localPath; // Fallback to original
  }
  
  return mapping[variant] || mapping.original || localPath;
}

/**
 * Get responsive image URLs for srcset
 * @param {string} localPath - Original local image path
 * @returns {Object} Object with src and srcset
 */
export function getResponsiveUrls(localPath) {
  const mapping = CLOUDINARY_IMAGES[localPath];
  if (!mapping || !mapping.publicId) {
    return { src: localPath, srcset: '' };
  }
  
  const baseUrl = `https://res.cloudinary.com/dmawj7tmu/image/upload`;
  const publicId = mapping.publicId;
  
  const sizes = [400, 800, 1200, 1600, 1920];
  const srcset = sizes.map(size => 
    `${baseUrl}/w_${size},f_auto,q_auto/${publicId} ${size}w`
  ).join(', ');
  
  return {
    src: `${baseUrl}/w_800,f_auto,q_auto/${publicId}`,
    srcset
  };
}
